(14628, 181, 0, 1, '吹喇叭 - (KS Remix) [Play Trumpet：Suck the penis - (KS Remix)]', '嘗試挑戰自己重新刷版，將台式的電子音樂美化大改造！也保留了“羅百吉”的最初原曲！製作上考量許多目前愛台味的聽眾程度…個人的電子音樂跟目前台灣廉價舞廳所播放的形式可以說完全不相同！台灣電子音樂一般環境都處在於一個尚未進化演變的過程…這樣的情況很令人擔憂！當然我所指的是部份的舞廳文化…與高檔舞廳的形式非常不能相比較…也希望就由這次機會將此曲美化一番！可以讓聽覺更好。\r\n\r\n我首次將自己的電音創作理念習性改變，以台式舞廳文化作為總基礎的重要關鍵！我也請教過在放過台式風的ＤＪ解說台式舞廳文化MIX中必須吸收的台電音類型…在多方面吸收之下，事實上我真的是非常的不好消化…由於台電音接受曲風差異太大！卻實我真的吃不消！為了這點可是傷透腦筋判斷考量創作Remix成品，適度給予歌曲不同風格表現…這樣的美化過程完工後，新一代曲風呈現給大家們品嘗看看！希望大家能喜歡。\r\n\r\n作品年份：2004（讓我最痛苦的一次挑戰）', '0000-00-00 00:00:00', 0000, 0, 2, 3, '', '', 426, '', 'KS (蘇凱群)、原曲：羅百吉', '羅百吉', 'KS (蘇凱群)', '凱斯音樂', '', 0, 0, 1, '2009-02-07 21:44:07', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14629, 181, 1608, 1, '吹喇叭 (KS Remix) [Play Trumpet：Suck the penis (KS Remix)]', '嘗試挑戰自己重新刷版，將台式的電子音樂美化大改造！也保留了“羅百吉”的最初原曲！製作上考量許多目前愛台味的聽眾程度…個人的電子音樂跟目前台灣廉價舞廳所播放的形式可以說完全不相同！台灣電子音樂一般環境都處在於一個尚未進化演變的過程…這樣的情況很令人擔憂！當然我所指的是部份的舞廳文化…與高檔舞廳的形式非常不能相比較…也希望就由這次機會將此曲美化一番！可以讓聽覺更好。\r\n\r\n我首次將自己的電音創作理念習性改變，以台式舞廳文化作為總基礎的重要關鍵！我也請教過在放過台式風的ＤＪ解說台式舞廳文化MIX中必須吸收的台電音類型…在多方面吸收之下，事實上我真的是非常的不好消化…由於台電音接受曲風差異太大！卻實我真的吃不消！為了這點可是傷透腦筋判斷考量創作Remix成品，適度給予歌曲不同風格表現…這樣的美化過程完工後，新一代曲風呈現給大家們品嘗看看！希望大家能喜歡。\r\n\r\n作品年份：2004（讓我最痛苦的一次挑戰）', '2004-11-18 00:00:00', 0000, 6, 0, 3, '', '', 426, '', 'KS (蘇凱群)、原曲：羅百吉', '羅百吉', 'KS (蘇凱群)', '凱斯音樂', '', 0, 1, 0, '2009-02-08 03:33:05', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
