(14640, 152, 1609, 1, '68 Dogs day (PART)', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '68 Dogs Day\r\n曲：IAN　詞：Tzara 編曲 FLAT CLUB\r\n\r\n把臉躺在柏油路面\r\n把斑馬線看成古柯鹼\r\n上膛的彈夾\r\n和Pick項鍊\r\n頑強的舌尖\r\n在琴弦上呻吟詩篇\r\n\r\n赭色的蟑螂也振翅高飛\r\n發霉的猶太麵包教人軟黏\r\n《嘔吐》式存在主義傳染無謂\r\n槍砲、病菌與鋼鐵無止盡永劫回歸\r\n\r\n無政府的狂癲\r\n無神論的妄言\r\n別讓青春的肉體再犧牲浪費\r\n針孔痕跡能說明一切\r\n\r\n把臉躺在柏油路面\r\n把斑馬線看成古柯鹼\r\n蘇聯坦克終結了那年春天\r\n愛之夏嬉皮少年捧著鮮花嚷著宣言\r\n\r\n於是68年的學運革命場景\r\n缺席的人只能在戲院悼念\r\n藍儂的身影變成件件T-Shirt\r\n蘇維埃的小說冰冷冷地躺在書櫃\r\n\r\n無政府的狂癲\r\n無神論的妄言\r\n別讓青春的肉體再犧牲浪費\r\n針孔痕跡能忘記一切\r\n\r\nOhh\r\nRight Now\r\nNow\r\nWhatever you shout\r\nAnd Cheers! Now!\r\nNow\r\nBe swinged away\r\nThe Dogs day\r\n只做愛不作戰\r\n就加入活死人世界多荒謬的謊言\r\n\r\nNow\r\nNow\r\nWhatever you doubt\r\nAnd Cheers! Now!\r\nNow\r\nBe swinged away\r\nThe Dogs day\r\n只做愛不作戰\r\n就吐出氤氳大麻煙圈然後視而不見\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', 234, '', 'IAN', 'Tzara', 'FLATCLUB', '', '', 0, 0, 1, '2009-02-08 15:55:12', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14641, 152, 1609, 2, '沒有影子的人', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '沒有影子的人\r\n曲：IAN 詞：Tzara 編曲：FLAT CLUB\r\n\r\n每天早上甦醒\r\n習慣性吃維他命\r\n仰天長嘯吶喊\r\n還是感到欲振乏力\r\n\r\n無論快樂悲傷\r\n車廂裡面看來全都一樣\r\n一成不變的活\r\n行事曆裡面沒有自己\r\n\r\n那唯一可靠的重量\r\n獃在十字路口曬著太陽\r\n赫然發現自己沒了影子\r\n為什麼會變成這樣\r\n\r\n沒有影子的人\r\n也別擔心沒了靈魂\r\n原本就失落的\r\n存在感　何止一朝一夕\r\n\r\n沒了影子之後\r\n生活變得不再苦悶\r\n反正已好多年\r\n行屍走肉過了半生\r\n\r\n那唯一可靠的重量\r\n獃在十字路口曬著太陽\r\n若又發現自己有了影子\r\n沒有什麼值得慶幸\r\n\r\n庸庸碌碌的快步追趕  我已厭倦\r\n汲汲營營的盲目追求  這不是當初的那一個我\r\n\r\n沒有影子的人\r\n也別擔心沒了靈魂\r\n原本就失落的\r\n存在感　何止一朝一夕\r\n\r\n沒了影子之後\r\n生活變得不再苦悶\r\n反正已好多年\r\n行屍走肉過了半生\r\n\r\n那唯一可靠的重量\r\n站在十字路口曬著太陽\r\n若又發現自己有了影子\r\n沒有什麼值得慶幸\r\n沒有什麼值得慶幸\r\n\r\n\r\n\r\n', '', 282, '', 'IAN', 'Tzara', 'FLAT CLUB', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:00:33', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14642, 152, 1609, 3, '純粹自我', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '社會化過程\r\n面對太多挫折\r\n忍受再忍受\r\n扼殺自我\r\n\r\n不想去融入\r\n這個共犯結構\r\n拒絕再拒絕\r\n純粹自我\r\n\r\n別靠近我\r\n別控制我\r\n我有自己的夢\r\n從一開始\r\n你沒真心過\r\n想利用我的\r\n\r\n別擺佈我\r\n別控制我\r\n我有自己的夢\r\n從現在起\r\n我要做自己\r\n自我\r\n\r\n', '', 267, '', 'IAN', 'Tzara', 'FLAT CLUB ', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:08:29', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14643, 152, 1609, 4, '螢光幕前', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '世界跟著妳打轉\r\n妳騷眉弄姿鎂光燈就不停的閃\r\n妳的髮型被視為潮流典範\r\n說實在我還是感到非常不習慣\r\n\r\n打開電視看見妳的消息\r\n翻開了報紙又發現妳上影劇版\r\n怎麼會剎那間變成另一個人\r\n忽然間心理面湧起了一陣心酸\r\n\r\n一瞬間\r\n就改變\r\n變兩個世界\r\n妳在七彩舞台\r\n我在螢光幕前很感慨\r\n\r\n世界跟著妳打轉\r\n妳一舉一動都成了眾人的焦點\r\n妳的驕傲被視為理所當然\r\n說實在我還是感到非常不喜歡\r\n\r\n妳侃侃而談妳的感情觀\r\n妳說妳從來沒有認真談一場戀愛\r\n雖然我很能體諒妳的為難\r\n坦白說還是感到非常難堪\r\n\r\n一瞬間\r\n就改變\r\n變兩個世界\r\n妳在七彩舞台\r\n我在螢光幕前很感慨\r\n\r\n承認吧\r\n男人總是犯賤的\r\n在失去了\r\n才又回想妳的好\r\n\r\n悔不當初的遺憾\r\n我翻來覆去甩不開回憶的糾纏\r\n隨著媒體曝光的頻繁\r\n嘴巴說厭煩還是目不轉睛的看\r\n\r\n打開衣櫃看見妳的外衣\r\n當時的場景如今又浮上了腦海\r\n雖然妳已經變成另一個人\r\n在我心中妳還是那位單純女孩\r\n\r\n\r\n終究沒人會知道\r\n你我之間的關係曾經那麼好\r\n也不用讓任何人知道\r\n現在的妳過的比過去還好就好\r\n\r\n\r\n\r\n', '', 349, '', 'IAN', 'Tzara', 'FLAT CLUB ', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:18:12', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14644, 152, 1609, 5, 'Say Hello!!!', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '如今你愣在轉角\r\n十一點鍾座標\r\n再不轉向恐怕船就要觸礁\r\n\r\n\r\n所以別投鼠忌器\r\n自顧不瑕緊張\r\n扭扭捏捏結結巴巴語焉不詳\r\n\r\nSay Hello Honey\r\nSay Hello Baby\r\nSay Hello lovery\r\nSay Hello sweetie\r\n\r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架(自拔)\r\n\r\n(廢話我也不想多嘮叨)\r\n可是你拐彎抹角\r\n面有難色尷尬\r\n欲言又止一點也不瀟灑大方\r\n\r\n\r\n還是想懸崖勒馬\r\n矜持不可自拔\r\n眼高手低吞吞吐吐失措慌張\r\n\r\nSay Hello Honey\r\nSay Hello Baby\r\nSay Hello lovery\r\nSay Hello sweetie\r\n\r\n\r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架(自拔)\r\n\r\n\r\ns\r\n所以你懂嗎\r\n現在的樣子阿\r\n在節骨眼上不計形象的誇\r\n就(會)是最後的贏家\r\nso\r\n所以你懂嗎\r\n現在的樣子\r\n在節骨眼上不計形象的誇\r\n就(會)是最後贏家\r\n\r\n\r\n\r\n', '', 303, '', 'IAN/Tzara', 'Tzara', 'FLAT CLUB', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:27:06', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14645, 152, 1609, 6, '遣悲懷', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '再一次我又開始學著依賴\r\n囓咬我\r\n再抱緊我\r\n千萬別醒過來\r\n用青春釀的體液將我灌溉\r\n充滿我\r\n再裝進我\r\n千萬別停下來\r\n在這荒亂的年代\r\n動不動就遣悲懷\r\n也無須問神怎麼辦\r\n\r\n現在開始\r\n只有虛無觀可以依賴\r\n麻醉我\r\n再槍決我\r\n好讓我痛快\r\n用妳最骯髒的手段將我侵占\r\n你懂不懂\r\n為何我心跳澎湃\r\n\r\n在這荒涼的年代\r\n動不動就遣悲懷\r\n也無須問神怎麼辦\r\n\r\n就別按耐心中的搔癢難耐\r\n和我一起\r\n一起感到天旋地轉\r\n就別按耐心中的搔癢難耐\r\n和我ㄧ起\r\n一起感到天旋地轉\r\n\r\n是我不應該這樣投降\r\n是我不應該這樣投降\r\n不自待\r\n在妳裙襬\r\n\r\n再一次我又開始學著依賴\r\n囓咬我\r\n再抱緊我\r\n千萬別醒過來\r\n用青春釀的體液將我灌溉\r\n充滿我\r\n再裝進我\r\n千萬別停下來\r\n\r\n', '', 383, '', 'IAN', 'Tzara', 'FLAT CLUB ', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:38:26', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14646, 152, 1609, 7, '謎寐', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, '\r\n淪陷在魚肚白晨曦的臉\r\n潮濕氣味讓人難以入寐\r\n無所謂值得留戀不如棧戀\r\n眼前的\r\n\r\n匍匐在潮紅的凝脂峰巔\r\n篝火閃爍慾念若隱若現\r\n無所謂值得留戀不如棧戀\r\n眼前的\r\n\r\n欣賞吧\r\n花蕾在床沿悄悄綻放\r\n放盪撲鼻花香\r\n鑲在櫻桃耳垂\r\n催打浪濤拍岸\r\n\r\n看\r\n覷看我的眼裡的你的眸\r\n謀殺空洞黎明\r\n明天又在那裡\r\n妳的無邪髮香\r\n\r\n\r\n', '', 258, '', 'IAN', 'Tzara', 'FLAT CLUB ', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:45:29', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14647, 152, 1609, 8, 'Don''t let me', '', '2009-02-08 00:00:00', 0000, 0, 1, 7, 'Don’t let me Know\r\nWhat Pain is For\r\nDon’t Let me Float\r\nFive minutes slow\r\n\r\nBut close your eye\r\nAnd Hold it tight\r\nWhere nothing is fine\r\nAnd it’s all Life  \r\n\r\nGave him gaze to bounce the ball strike all your viand\r\nTill the world the child was in list should be hidden\r\nAnd my music fade out you still feel Land dry\r\nRolling stone decay on the ground became High\r\n\r\n\r\nDon’t let me Know\r\nWhat Pain is For\r\nDon’t Let me fall\r\nFrom Broken Home\r\n\r\nThis career is mine?\r\nNobody sign\r\nWhere nothing is fine\r\nAnd it’s all Life  \r\n\r\nGave him gaze to bounce the ball strike all your viand\r\nTill the world the child was in list should be died\r\nAnd my music fade out you still feel them dry\r\nRolling stone decay on the ground became High\r\n\r\nWaste the time\r\nWaste the time\r\nWaste the time\r\nWaste the time\r\n\r\n(SOLO)\r\n\r\nDon’t let me Know\r\nWhat Pain is For\r\nDon’t Let me Float\r\nFive minutes slow\r\n\r\nBut close your eye\r\nAnd Hold it tight\r\nWhere nothing is fine\r\nAnd it’s all Life \r\n\r\nGave him gaze to bounce the ball strike all your viand\r\nTill the world the child was in list should be hidden\r\nAnd my music fade out you still feel Land dry\r\nRolling stone decay on the ground became High\r\n\r\nIN nightmare dream\r\nI decide\r\nHardly try\r\nThe boat was sucked\r\n\r\nIN nightmare dream\r\nI decide\r\nHardly try\r\nmelted in the sun\r\n\r\n\r\nWaste the time\r\nWaste the time\r\nWaste the time\r\nWaste the time\r\n\r\n\r\n', '', 347, '', 'Tzara/IAN', 'Tzara', 'FLAT CLUB', 'FLAT CLUB', '', 0, 0, 1, '2009-02-08 16:55:28', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
