(14650, 10104, 0, 1, '都市叢林', '收錄於露魅2009年獨立發行之EP 《I Lost Myself For The Last Time》\r\n\r\n此曲為金穗獎入圍短片「拐彎的夏天」的主題曲', '2009-03-14 00:00:00', 0000, 20, 0, 7, '都市叢林 \r\n\r\n\r\n\r\n\r\n城市籠罩著疲憊\r\n荒蕪叢林仍舊漆黑\r\n就在那一瞬間\r\n模糊了視線\r\n\r\n守護最後的防線\r\n咆哮呻吟也喚不回\r\n嘆息著\r\n永恆的殘缺\r\n\r\n\r\n危險的氣味\r\n瀰漫在都市叢林間\r\n枯萎了淡紫色玫瑰\r\n我的心在掉淚\r\n盲目的改變\r\n迷失在都市叢林間\r\n冷卻了炙熱的血液\r\n失控的往下墬\r\n\r\n有種被囚禁的感覺\r\n在我身上無止盡的蔓延 無止盡蔓延\r\n\r\nhelp me  help me  help me  help me now\r\n我還能夠走到哪裡 還能夠撐到哪裡\r\n\r\n在日落之前 笑最後一遍\r\n被吞蝕之前 放肆的飛\r\n', '', 281, '', '陳宏揚', '陳宏揚', '露魅', '', '', 0, 1, 0, '2009-02-09 16:32:02', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14651, 6200, 0, 1, '來回', '', '0000-00-00 00:00:00', 0000, 5, 0, 4, '多希望綠燈多一點　知道你等不急\r\n多希望車開快一點　不想要停了又停\r\n習慣了沿路的風景　怎麼都看不膩\r\n終於又來到了這裡　我們能在一次靠近\r\n\r\n因為向上帝預支三年時間\r\n所以要用更多的距離來賠\r\n用更多想念　更多眼淚\r\n還有更多的電話錢\r\n你說對生活感到孤單與疲憊\r\n只要能夠見到面就會覺得安慰\r\n就算沉默是溝通的語言\r\n也甘願\r\n', '', 290, '', '蔡翰昇', '蔡翰昇', '複製貼上', '', '', 0, 0, 1, '2009-02-09 21:05:46', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
