(14655, 6200, 0, 4, '醺(live)', '', '2010-10-09 00:00:00', 0000, 0, 1, 7, '幽默藉由酒精　戴上小丑面具\r\n四十三度空氣　醞釀家庭悲劇\r\n\r\n小丑耍著猴戲　手中緊握酒瓶\r\n觀眾熱烈反應　上演一齣酒池肉林\r\n\r\n拖著緩慢身軀　表演持續進行\r\n是誰失去耐心　早已毫不在意\r\n\r\n影子離開身體　視線漸漸透明\r\n思緒無法清晰　聽不見眼淚的聲音\r\n\r\n界線不明　七分醉意三分清醒\r\n小丑面具　笑容僵硬沒有表情\r\n\r\n交易進行　角色更替身不由己\r\n親愛的你　究竟是去了　哪裡', '', 294, '', '蔡翰昇', '蔡翰昇', '複製貼上', '', '', 0, 0, 0, '2009-02-09 21:21:34', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14656, 6200, 0, 5, 'Purple', '複製貼上首波邪惡抒情主打', '0000-00-00 00:00:00', 0000, 5, 0, 9, '紫色的旋律　不安的氣息\r\n視線已模糊　找尋我的記憶\r\n吞噬了光線　暈炫的空間裡\r\n留下了一抹　無限的神秘\r\n\r\n夜　將你渲染成一種寂寞\r\n想不透　是誰被你佔領\r\n\r\n我不願放下　雨過最後的顏色\r\n你就享受著　對世間一切迷惑\r\n留下的步伐　是少女還是巫師\r\n白色的天堂　會將你拋下\r\n\r\n纏繞著枝葉　在黑暗中棲息\r\n是哪個國度　我已分不清\r\n想用力抱緊　就算腐蝕了心\r\n卻無法呼吸\r\n\r\n淚　是你感到了夜的寂寞\r\n想不透　我曾被你佔領\r\n\r\n', '', 357, '', '張竣傑', '張竣傑', '複製貼上', '', '', 0, 0, 1, '2009-02-09 21:23:09', '2013-10-07 17:14:17', '0000-00-00 00:00:00'),
(14657, 6200, 0, 6, 'Stomy Night(live)', '', '2010-10-09 00:00:00', 0000, 5, 0, 9, 'One smoggy day I sail my battleship to carry mission \r\nI see the moonlight take my way and give my true direction\r\nThe torrential rain like an arrow stabbed my whole conviction\r\nThunder to rend the skeis we fear of the apprehension\r\n\r\nWarrior could you beat down Kraken\r\nFighting on the iceberg of war\r\n\r\nFerocious wave drown in deck is that your indignation\r\nDon''t let the devil try to control my cerebration\r\n\r\nWarrior could you facing destiny\r\nTo take our courage in both hands\r\n\r\nIn stormy night I look for the holy light\r\nJust take my pain from the hell\r\nIn stormy night no one can stop my goal\r\nSteady heart will never die\r\n', '', 206, '', '張竣傑', '張竣傑', '複製貼上', '', '', 0, 0, 1, '2009-02-09 21:24:27', '2013-10-07 17:14:18', '0000-00-00 00:00:00'),
(14658, 6200, 0, 7, '我不是Metallica(live)', '', '2010-10-09 00:00:00', 0000, 5, 0, 9, '空氣中是否還殘留你的香味    \r\n混亂中你的出現　一樣心碎    \r\n有太多想要了解卻沒有機會    \r\n你突然轉身走遠我這才發現    \r\n\r\n故事發生那天的夜          \r\n我沒有掙扎也沒後悔\r\n\r\n\r\n忘了吧 散了吧 是我傻\r\n我不是Metaliica\r\n\r\n忘了吧 算了吧 就這樣\r\n我對自己說實話', '', 313, '', '徐鴻源', '徐鴻源', '複製貼上', '', '', 0, 0, 1, '2009-02-09 21:25:34', '2013-10-07 17:14:18', '0000-00-00 00:00:00'),
(14659, 6200, 0, 1, '九五加滿', '機車加一次油要200元!!會不會太離譜啊~~', '0000-00-00 00:00:00', 0000, 5, 0, 1, '看著最進不斷不斷上漲的物價\r\n而我的薪水到底可以領了嗎\r\n總是不斷不斷告訴自己別亂花\r\n但是到月底不小心就花光光\r\n\r\n當我享受著那高速所帶來的暢快\r\n油錶卻一直降落\r\n\r\n九五加滿要兩百元\r\n能否再說一遍\r\n打開皮包忘了帶錢\r\n留下我的涙\r\n九五加滿好貴\r\n\r\n拿了許多衛生紙和喝不完的礦泉水\r\n那麼還給你 算我便宜好不好\r\n\r\n', '', 240, '', '張竣傑', '張竣傑', '複製貼上', '', '', 0, 0, 1, '2009-02-09 21:31:01', '2013-10-07 17:14:18', '0000-00-00 00:00:00'),
