(14662, 9827, 0, 1, 'After That ( After Reading Her Diary... )', '當然這不是我們團的Main Style拉\r\n是高三的時候 \r\n" 有感而發 " 的一曲\r\n\r\n套一句宇宙人樂團的用詞兒\r\n" 這是舊時代的產物 "\r\n\r\n不過是2009年的版本\r\n\r\n雖然沒有千年傳統 \r\n但也是全新感受呢\r\n\r\n\r\n顆顆', '0000-00-00 00:00:00', 0000, 0, 2, 1, '翻著我的回憶 \r\n心    又碎了一地               \r\n夏天    窗外的風卻\r\n不再清新\r\n\r\n也許    若即若離 \r\n就是最美距離\r\n讓我無法前進也 \r\n不能放棄  \r\n\r\n愛 還在 \r\n或許 這就是所謂的 \r\n" 還有著期盼 不願離開 "\r\n我 想愛 \r\n到底 怎樣才能符合你的 期待 \r\n別讓我再 傻傻等待\r\n\r\n\r\n假裝    毫不在意 \r\n你的一字一句\r\n慢慢    腐蝕著我 \r\n脆弱的勇氣\r\n\r\n可能    你也忘記 \r\n我的所有努力\r\n但    也許有天\r\n你也會想起\r\n\r\n愛 還在 \r\n或許 這就是所謂的 \r\n" 還有著期盼 不願離開 "\r\n我 想愛 \r\n到底 怎樣才能符合你的 期待 \r\n別讓我再 傻傻等待\r\n\r\n', '', 236, '', '棠棠', '棠棠', '棠棠', 'Rosewood Honey Trio Inc.', '', 0, 0, 1, '2009-02-10 01:09:29', '2013-10-07 17:14:18', '0000-00-00 00:00:00'),
(14663, 1932, 0, 1, '騙子', '', '0000-00-00 00:00:00', 0000, 15, 0, 1, '原來如此 我們都是個騙子\r\n\r\n慢慢編織 謊言把你我吞噬\r\n\r\n太多迷思 找不到依據可以證實\r\n\r\n難道要繼續躲在象牙塔把自己鎖死\r\n\r\n\r\n事實如此 我們都是個騙子\r\n\r\n說再多次 也無法適可而止\r\n\r\n人人都是 爾虞我詐言過其詞\r\n\r\n你還在傻傻等待你的夢想真實\r\n\r\n你的謊好無知\r\n太過虛偽不實\r\n\r\nHEY! 能不能就到此為止\r\n停止這一切的虛假事實\r\n\r\nHEY! 能不能就到此為止\r\n逃離這一切的虛擬真實', '', 251, '', '', '', '', '', '', 1, 1, 0, '2009-02-10 02:39:30', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14664, 1932, 0, 2, '消遣', '', '0000-00-00 00:00:00', 0000, 15, 0, 7, '酒 喝完一杯又一杯\r\n到底是醒還是醉\r\n我 我的身邊沒人陪\r\n你也早已無所謂\r\n\r\n霓虹燈 五彩地 閃爍地 照耀著\r\n我的眼淚\r\n\r\n你的笑 迷人地 嫵媚地 諷刺著\r\n我的愚昧\r\n\r\n又一次哭到崩潰\r\n痛得渾身都粉碎\r\n太多虛無的謊言 早已經無從分辨\r\n要我如何在迷霧中找到一絲光線\r\n\r\n我以為我很特別\r\n原來也只是消遣\r\n揭開偽善的假面 給你再一次機會\r\n別再隨便四處擁抱恣意親吻我的嘴', '', 207, '', '', '', '', '', '', 1, 1, 0, '2009-02-10 02:41:56', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14665, 1932, 0, 3, '壞天氣', '', '0000-00-00 00:00:00', 0000, 15, 0, 4, '天空 下起雨\r\n\r\n房間裡 卻快窒息\r\n\r\n一次一次深呼吸\r\n\r\n像隻缺氧的魚\r\n\r\n傘尖的雨滴\r\n\r\n滑落進 我指尖裡\r\n\r\n\r\n一整缸的菸蒂\r\n\r\n再也沒有你的氣息\r\n\r\n我的心也是壞天氣\r\n\r\n\r\n溼透的帆布鞋它再也不願去遠行\r\n\r\n找不到目標和意義\r\n\r\n\r\n背包裡相機裝了好多美好的記憶\r\n\r\n只可惜早已被刪去\r\n\r\n強迫忘記', '', 312, '', 'The Fever Cats', 'Niggy ', '', '', '', 1, 1, 0, '2009-02-10 02:45:16', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
