(14671, 10134, 1611, 3, '等', '《等》是這張專輯的主打歌曲， 也是整張專輯的主要概念 。 對於烏風鈴，由一開始接觸音樂至今天，最讓他們感覺疲憊的就是漫長的等待。而，要將這種艱辛又期待的感覺完全表達出來 真的很複雜。所以寫了這首歌把等待的感覺，以等待一個人的方式將情緒一一述説。“尤其是副歌的部分可以聽到重復又重復的‘誰讓我忘了時辰，誰讓我忘了歲月不留人’的幾句歌詞，為的就是想讓聼者明白，等待其實就是重復又重復的做著一些不知道結果的事” 同時，這張《等》也是烏風鈴等待已久的， 所以用《等》做為主題真的最適當不過了。  ', '2009-02-10 00:00:00', 0000, 20, 0, 7, '', '', 313, '', '烏風鈴', '烏風鈴', '烏風鈴', 'Warner/Chappell', '', 1, 0, 0, '2009-02-10 15:54:11', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14672, 10134, 1611, 4, '我相信', '由Bot詞曲的《我相信》，被臺灣“校園快樂幫”歌唱比賽出身的新人歌手鄭博夫選唱，收錄在臺灣《校園歌喉戰冠軍合輯》，管啟源老師為歌曲“變裝”，賦予嶄新的一面，為《我相信》重新填上新歌詞，取名《受害者》，抒情哀愁的曲子，配上鄭博夫天生憂鬱的嗓子，在臺灣受到廣大歌迷喜愛。這首歌成了Bot第一首“出口”到臺灣的創作，給了他很大很大的鼓勵！\r\n\r\n多愁善感的Bot自喻是個想太多的人，在感情世界裏，他有著一番甜蜜之外的見解。“在愛情的路上，只有你愛我和我愛你是不足夠的，兩個不同成長背景的人，如何在一起生活一輩子，那才是最大考驗！”\r\n\r\n感性中帶著理性的思考模式，在Bot的創作裏顯而易見。\r\n', '2009-02-10 00:00:00', 0000, 20, 0, 4, '', '', 250, '', '烏風鈴', '烏風鈴', '烏風鈴', 'Warner/Chappell', '', 1, 0, 0, '2009-02-10 15:55:13', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14673, 10134, 1611, 5, '目光', '', '2009-02-10 00:00:00', 0000, 20, 0, 7, '', '', 232, '', '烏風鈴', '烏風鈴', '烏風鈴', 'Warner/Chappell', '', 1, 0, 0, '2009-02-10 15:56:15', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
(14674, 10134, 1611, 6, '無聊人', '只有無聊的人才能寫出無聊的歌，《無聊人》詞-Bot一心一意想當無聊的人，因為他認為，有閒情享受無聊的人才是世界上最幸福的人！“我們4人平時都有自己的專業崗位，我是錄音師，Chuan是攝影師，有自己的Studio要經營，而鼓手Jerry是網頁設計師，吉他手Sam則是平面設計師，很多時候我們都很忙，忙得錯過身邊許多美好的事物，因此我們都很珍惜在一起玩音樂的時光。都市的生活節奏非常快，無所事事的時間變得很奢侈，我很需要時間來‘無聊’，無聊對我來說是一種休息和沉澱的意義，不一定要刻意做些什麼或想些什麼，即使坐著發呆也珍貴！有時不想出門，朋友打電話來我會告訴對方我很忙，其實我在忙著無聊！哈哈！”', '2009-02-10 00:00:00', 0000, 20, 0, 7, '', '', 192, '', '烏風鈴', '烏風鈴', '烏風鈴', 'Warner/Chappell', '', 1, 0, 0, '2009-02-10 15:57:06', '2015-03-12 13:37:59', '0000-00-00 00:00:00'),
